      SELECT DISTINCT col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( ( - 82 * - col2 * + 37 ) NOT IN ( - 64 ) ) OR ( col2 ) IN ( + 33 * col2 );
  - name: tab2

outputs:
  - name: q5245.out
    data: |
